            .y(function(d) { return d[opts.y] })
        }
          
         
        chart
  .useInteractiveGuideline(false)
  .showLegend(true)
  .margin({
 "left":     50 
})
          
        chart.xAxis
  .tickFormat(
      function(d) {return d3.time.format('%Y-%m-%d')(new Date((d+1)*1000*3600*24));}
      )
  .rotateLabels(   -10)
  .axisLabel("Time:Learning Divergence in Volatility Control Mechanism -> Major MWBANK Indices using Algorithmic Analytics (_oio_)")
  .width(    40)

        
        
        chart.yAxis
  .axisLabel("Value (x100) ")
  .width(    40)
      
       d3.select("#" + opts.id)
        .append('svg')
        .datum(data)
        .transition().duration(500)
        .call(chart);

       nv.utils.windowResize(chart.update);
       return chart;
      });
    };
</script>
